import SwiftUI
import Foundation
#if canImport(UIKit)
import UIKit
#endif

enum HomeHeaderAsset {
    static let base64: String = """

"""

    static func image() -> Image {
#if canImport(UIKit)
        if let data = Data(base64Encoded: base64),
           let uiImage = UIImage(data: data) {
            return Image(uiImage: uiImage)
        }
#endif
        return Image(systemName: "photo")
    }
}
